import React from "react";
import "./about.css";
import img1 from "../../img/IMG1.PNG";

function about() {
  return (
    <div className="a">
      <div className="a-left">
        <div className="a-card"></div>
        <div className="a-card">
        <img src={img1} alt="" className="a-img" />
        </div>
      </div>
      <div className="a-right"></div>
    </div>
  );
}

export default about;
